window.bookSummaryJSON = "<p>A puzzle box continues to stump Cheyenne. Time to look elsewhere, but will the Goth Drow find the answers she needs without it?</p> <p>Classes continue, and the FRoE is finally taking the hint that her work has to be extracurricular activities. She has just as much to learn from them as she does from college.</p> <p>Their lessons are just a lot more dangerous and deadly.</p> <p>Who can Cheyenne trust while she learns to control her growing powers?</p> <p>Then there's her father. Can she give him another chance?</p>"; 
